import React, { useState, useEffect } from 'react';
import { Modal } from '@consta/uikit/Modal';
import { TextField } from '@consta/uikit/TextField';
import { Button } from '@consta/uikit/Button';
import { Grid, GridItem } from '@consta/uikit/Grid';

interface Customer {
  id: number;
  customerCode: string;
  customerName: string;
  customerInn: string;
  customerKpp: string;
  customerLegalAddress: string;
  customerPostalAddress: string;
  customerEmail: string;
  customerCodeMain: string | null;
  isOrganization: boolean;
  isPerson: boolean;
}

type Props = {
  isOpen: boolean;
  onClose: () => void;
  handleUpdateCustomer: (updatedCustomer: Customer) => void;
  currentCustomer: Customer | null;
};

const UpdateCustomerModal: React.FC<Props> = ({
  isOpen,
  onClose,
  handleUpdateCustomer,
  currentCustomer,
}) => {
  const [updatedCustomer, setUpdatedCustomer] = useState<Customer | null>(
    currentCustomer
  );

  useEffect(() => {
    setUpdatedCustomer(currentCustomer);
  }, [currentCustomer]);

  const handleInputChange =
    (field: keyof Customer) => (value: string | null) => {
      if (updatedCustomer) {
        setUpdatedCustomer((prev) => ({
          ...prev!,
          [field]: value ?? '',
        }));
      }
    };

  const handleSubmit = () => {
    if (updatedCustomer) {
      handleUpdateCustomer(updatedCustomer);
    }
  };

  return (
    <Modal
      isOpen={isOpen}
      onClose={onClose}
      style={{ maxWidth: '800px', position: 'relative' }}
    >
      <div style={{ padding: '20px', paddingBottom: '80px' }}>
        <h3>Обновление заказчика</h3>
        {updatedCustomer && (
          <Grid cols={3} gap="m" style={{ marginBottom: '110px' }}>
            <GridItem>
              <TextField
                label="Наименование"
                value={updatedCustomer.customerName}
                onChange={handleInputChange('customerName')}
                placeholder="Введите наименование"
              />
            </GridItem>
            <GridItem>
              <TextField
                label="ИНН"
                value={updatedCustomer.customerInn}
                onChange={handleInputChange('customerInn')}
                placeholder="Введите ИНН"
              />
            </GridItem>
            <GridItem>
              <TextField
                label="КПП"
                value={updatedCustomer.customerKpp}
                onChange={handleInputChange('customerKpp')}
                placeholder="Введите КПП"
              />
            </GridItem>
            <GridItem>
              <TextField
                label="Юридический адрес"
                value={updatedCustomer.customerLegalAddress}
                onChange={handleInputChange('customerLegalAddress')}
                placeholder="Введите юридический адрес"
              />
            </GridItem>
            <GridItem>
              <TextField
                label="Почтовый адрес"
                value={updatedCustomer.customerPostalAddress}
                onChange={handleInputChange('customerPostalAddress')}
                placeholder="Введите почтовый адрес"
              />
            </GridItem>
            <GridItem>
              <TextField
                label="Электронная почта"
                value={updatedCustomer.customerEmail}
                onChange={handleInputChange('customerEmail')}
                placeholder="Введите электронную почту"
              />
            </GridItem>
            <GridItem>
              <TextField
                label="Вышестоящий контрагент"
                value={updatedCustomer.customerCodeMain}
                onChange={handleInputChange('customerCodeMain')}
                placeholder="Введите код вышестоящего контрагента"
              />
            </GridItem>
          </Grid>
        )}
      </div>
      <div
        style={{
          position: 'absolute',
          bottom: '20px',
          left: '20px',
          display: 'flex',
          gap: '10px',
        }}
      >
        <Button label="Обновить" onClick={handleSubmit} />
        <Button label="Отмена" onClick={onClose} />
      </div>
    </Modal>
  );
};

export default UpdateCustomerModal;
